<p>上一篇文章中讲解了什么是微服务，微服务的演进。那么我们应该 <strong>在什么时候进行服务的拆分，如何拆分？拆分后会到来哪些问题，如何解决</strong>？这些都是微服务需要考虑的问题。</p>
